import React from "react";

function Footer() {
  return (
    <div className="Foot">
      <h1 className="retroshadow foot-h1">I Study At</h1>
      <div className="foot-img-cont">
        <img src={VIT} width="500px" height='800px'/>
      </div>
    </div>
  );
}

export default Footer;
